   "source": [
    "# **Get the Data Together!** ‚Äì Wrangling and Combining Datasets üîÑ<a class=\"anchor\"  id=\"chapter4\"></a>\n",
    "\n",
    "If we take a look into our database, we can see that Cyclist have organized the data for the last years monthly. As we want to perform a broad analysis of the data, spanning more than one year (2021 ‚Äì 2023), it might get tedious to load and analyze the all monthly tables separately. To avoid that, we will combine the respective monthly datasets into **yearly tables**, clean them and lastly combine the information into one big dataframe. \n",
    "\n",
    "It is possible to read each table separately and then use the `rbind()` or `bind_rows()` (from the `dplyr` library) functions. However, in order to optimize the process and, most importantly, for practice sake, I created a customized function for reading the csv tables of a directory and creating a list with all the monthy tables for a given year.\n",
    "\n",
    "## Custom function for reading monthly tables in yearly list <a class=\"anchor\"  id=\"subsection4_1\"></a>\n",
    "\n",
    "The following function takes two arguments:\n",
    "- *directory path*: path to the directory storing the monthly tables.\n",
    "- *year*: the desired year.\n",
    "\n",
    "And it outputs a list with all the data frames for the given year"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 6,
   "id": "1fee9a84",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2024-01-25T08:56:18.233986Z",
     "iopub.status.busy": "2024-01-25T08:56:18.232450Z",
     "iopub.status.idle": "2024-01-25T08:56:18.245888Z",
     "shell.execute_reply": "2024-01-25T08:56:18.244330Z"
    },
    "papermill": {
     "duration": 0.029915,
     "end_time": "2024-01-25T08:56:18.248291",
     "exception": false,
     "start_time": "2024-01-25T08:56:18.218376",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "load_tables <- function(directory_path, year) {\n",
    "  # Create empty list for storing the data frames\n",
    "  yearly_trips_list <- list()\n",
    "  # Loop through each month from January (1) to December (12)\n",
    "  for (month in 1:12) {\n",
    "    # Format the month to have leading zeros if necessary (e.g., 01, 02, ..., 12)\n",
    "    # %d represents a decimal integer\n",
    "    # 02% two-digit string with leading zeros \n",
    "    month_str <- sprintf(\"%02d\", month)\n",
    "    # File path for each month's CSV file\n",
    "    file_path <- sprintf(\"%s/%d_%s.csv\", directory_path, year, month_str)\n",
    "    # Check if file exists\n",
    "    if (file.exists(file_path)) {\n",
    "      # Generate a variable name based on the file being read\n",
    "      var_name <- paste(\"trips_\", year, month_str, sep = \"\")\n",
    "      # Read the CSV file and assign it to the variable name\n",
    "      assign(var_name, read.csv(file_path))\n",
    "      # Append the loaded data frame to the tables_list\n",
    "      yearly_trips_list[[var_name]] <- get(var_name)\n",
    "    }\n",
    "  }\n",
    "  return(yearly_trips_list)\n",
    "}"
   ]
  },
