    "# **Cleaning and Sorting Data** üßπ<a class=\"anchor\"  id=\"chapter5\"></a>\n",
    "### Dropping NA Values? <a class=\"anchor\"  id=\"subsection5_1\"></a>\n",
    "Now that we have our data together, we could start our cleaning process by the obvious step of removing the NA's values present the `end_lat` and `end_lng` columns of our dataset. However, we should consider if this step is worthy and, more importantly, if **it might affect the integrity** of our data. Removing the rows with NA's values means deleting data for more than 17k rides so we should ask ourselves: for what kind of analysis is this cleaning step useful? Only if we want to perform an analysis of rides routes or ending stations location. We have a limited time so I won't go so deep for now. However, let's keep this information in mind so that we can proceed with the removal of NA values if needed. We will run a further chunck of code to precisely identify if we have any other NA values"
   ]
