   "source": [
    "As we can see, we have a high number of NA values for the information regarding the stations used. Following the previous argumentation, we will proceed to the cleaning of these data at the moment of focusing at this type of data.\n",
    "\n",
    "### Checking Usertype Data <a class=\"anchor\"  id=\"subsection5_2\"></a>\n",
    "Our study should focus on the difference of behaviour between casual riders and members. So, first of all, let's check if the terminology for user types is consistent through our data. Just for programming practice, I have created a custom function that automatises the process of searching for invalid user types (other than *member* or *casual*"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 12,
   "id": "7d270b8b",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2024-01-25T09:02:52.430243Z",
