   },
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "[1] \"There are no null values\"\n",
      "[1] \"All users are valid\"\n"
     ]
    }
   ],
   "source": [
    "# Declare the function\n",
    "check_invalid_user <- function(data){\n",
    "  # Check for null values in 'member_casual' column\n",
    "  null_user <- sum(is.null(data$member_casual))\n",
    "  # Check for values different from member or casual\n",
    "  not_valid_user <- sum(!(data$member_casual %in% c(\"member\",\"casual\" )))\n",
    "  if (null_user > 0){\n",
    "    print(paste(\"There are\", null_user, \"null values.\"))\n",
    "  }\n",
    "  else {\n",
    "    print(\"There are no null values\")\n",
    "  }\n",
    "  if (not_valid_user > 0){\n",
    "    print(paste(\"There are\", not_valid_user, \"not valid users.\"))\n",
    "  }\n",
    "  else {\n",
    "    print(\"All users are valid\")\n",
    "  }\n",
    "}\n",
    "\n",
    "# Search for invalid user types\n",
    "check_invalid_user(total_trips)"
   ]
  },
