   "source": [
    "#### Cleaning `duration_seconds`\n",
    "We have to check that there are no negative values in the `duration_seconds` column. Additionally, I will consider any ride shorter than 30 seconds as unintended ride, as such short rides can not be considered as representative for the usage dynamics of Cyclistic. In order to achieve this, we will proceed firstly by declaring a function that search for negative `duration_seconds` values and run it with our `total_trips` dataset."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 16,
   "id": "071f3fa6",
   "metadata": {
    "execution": {
     "iopub.execute_input": "2024-01-25T09:03:23.982610Z",
     "iopub.status.busy": "2024-01-25T09:03:23.981409Z",
     "iopub.status.idle": "2024-01-25T09:03:24.188909Z",
     "shell.execute_reply": "2024-01-25T09:03:24.187044Z"
    },
    "jupyter": {
     "source_hidden": true
    },
    "papermill": {
     "duration": 0.225496,
     "end_time": "2024-01-25T09:03:24.191926",
     "exception": false,
     "start_time": "2024-01-25T09:03:23.966430",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "[1] \"There are 509 negative values.\"\n",
      "[1] \"There are 224240 values smaller than 30s.\"\n"
     ]
    }
   ],
   "source": [
    "# Declare function for searching negative values\n",
    "check_negative_duration <- function(data){\n",
    "  # Checking for negative values in 'duration_sec' column\n",
    "  negative_duration <- sum(data$duration_seconds < 0)\n",
    "    short_duration <- sum((data$duration_seconds >= 0) & (data$duration_seconds < 30))\n",
    "  \n",
    "  # Check if any values are negative\n",
    "  if (negative_duration) {\n",
    "    print(paste(\"There are\", negative_duration, \"negative values.\"))\n",
    "  } else {\n",
    "    print(\"There are no negative duration values.\")\n",
    "  }\n",
    "  # Check if any values smaller than 30 s\n",
    "  if (short_duration) {\n",
    "    print(paste(\"There are\", short_duration, \"values smaller than 30s.\"))\n",
    "  } else {\n",
    "    print(\"There are no values smaller than 30s.\")\n",
    "  } \n",
    "}\n",
    "\n",
    "check_negative_duration(total_trips)"
   ]
  },
