   "source": [
    "The custom function `check_negative_duration()` returns the **negative values (509)** and the number of **rides shorter than 30s (224,240)**. Specially remarkable is the big ammount of rides under 30s. This might be an insight leading to further investigation, since it is not reasonable that so many customers are using Cyclist for such short rides. But we should focus on answering the key question of our study, e.g. ‚ÄúIn what ways do members and casual riders use Divvy bikes differently?‚Äù. So let's proceed by **cleaning the data of rides having negative or <30s duration**."
