    "# Add columns for year, month, weekday and hour\n",
    "total_trips_v2 <- total_trips_v1 %>%\n",
    "  mutate(\n",
    "    year = year (started_at),\n",
    "    month = month(started_at),\n",
    "    weekday = wday(started_at, label = TRUE),  # Use label = TRUE for weekday names\n",
    "    hour = hour(started_at)\n",
    "  )\n",
    "# Check our dataset\n",
    "summary(total_trips_v2)"
   ]
