    "- Completeness\n",
    "- Consistency\n",
    "- Accuracy\n",
    "- Relevance\n",
    "\n",
    "We have also assured tracking of changes on the original dataset by creating new versions, allowing us to come back to previous versions if necessary. Now, we can dive into the next step of data analysis study: the **Analyze phase**. But first, we will just **save our clean data set** for further analysis with the `write.csv()` function."
