   "source": [
    "# **Analyzing our Data** üìäüìâüìà<a class=\"anchor\"  id=\"chapter6\"></a>\n",
    "Now that we have finishing gathering, preparing, wrangling and cleaning our dataset, we can start gaining insights about our data through the **Analysis phase**. We will go through different steps that will address the **usage differences between casual riders and members**, by comparative analysis including: \n",
    "1. Current **Proportion of Member / Casual Riders rides** and Evolution from Year 2021 to 2023.\n",
    "2. **Rides Duration**.\n",
    "3. Usage by **Yearly Months**.\n",
    "4. Usage by **Weekday**.\n",
    "4. Usage by **Daily Hours**.\n",
    "5. Usage by **Rideable Type**.\n",
    "6. Most used **Stations**.\n",
    "7. Rides Distribution by **Chicago Neighborhoods**.\n",
    "\n",
    "## 1. Member / Casual Riders Usage <a class=\"anchor\"  id=\"subsection6_1\"></a>\n",
    "Given the rides of year 2023, we are going to calculate the proportion of rides by members and casual riders in this year. Then, we will analyze the evolution of this distribution through the years 2021 ‚Äì 2023. \n",
    "We are going to start visualizing results, so we will load the `ggplot2` library."
   ]
  },
