   "source": [
    "library(ggplot2) # Load ggplot2 library\n",
    "\n",
    "# Number/Proportion of members and casuals\n",
    "total_trips_v2 %>%\n",
    "  group_by(usertype, year) %>% \n",
    "  summarise(rides = n()) %>% \n",
    "  group_by(year) %>% \n",
    "  mutate(percentage = round(rides / sum(rides) * 100)) %>% \n",
    "  arrange(desc(year))\n",
    "\n",
    "# Visualize evolution of members / casual riders number of rides\n",
    "total_trips_v2 %>%\n",
    "  group_by(usertype, year) %>%\n",
    "  summarise(number_of_rides = n()) %>% \n",
    "  arrange(usertype, year) %>% \n",
    "  ggplot(aes(x = as.factor(year), y = number_of_rides, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "  coord_flip() +\n",
    "  labs(title = \"Number of Rides per User by Year\",\n",
    "       x = \"Year\",\n",
    "       y = \"Number of Rides\",\n",
    "       fill = \"User\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") +\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    axis.text = element_text(size = 10, color = \"black\"),\n",
    "    axis.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.text = element_text(size = 10, color = \"black\"),\n",
    "    plot.title = element_text(size = 14, color = \"black\")\n",
    "  )\n"
   ]
  },
