   "source": [
    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "- There are more rides by members users than by casual riders (with a proportion of about 60 / 40).\n",
    "- Through the last three years, the tendency has been an increase of member rides in detriment of casual riders.\n",
    "\n",
    "\n",
    "## 2. Comparative Analysis on **Rides Duration** <a class=\"anchor\"  id=\"subsection6_2\"></a>\n",
    "We will drive now our attention to the duration of the rides performed by members and casual riders. We will try to asset any differental behaviour regarding this parameter."
   ]
