   "source": [
    "# Descriptive analysis on rides duration for all trips.\n",
    "summary(total_trips_v2$duration_seconds)\n",
    "\n",
    "# Average trip duration by user type\n",
    "aggregate(total_trips_v2$duration_seconds ~ total_trips_v2$usertype, FUN = mean)\n",
    "# CONCLUSION: casual riders have longer average trip duration (1822.15s) vs members (788s)\n",
    "# Mean trip duration by user type\n",
    "aggregate(total_trips_v2$duration_seconds ~ total_trips_v2$usertype, FUN = median)\n",
    "# CONCLUSION: the most often duration for casual riders is 833s, longer than members (546s)\n",
    "\n",
    "# Max ride duration by user type\n",
    "aggregate(total_trips_v2$duration_seconds ~ total_trips_v2$usertype, FUN = max)\n",
    "# Min ride duration by user type\n",
    "aggregate(total_trips_v2$duration_seconds ~ total_trips_v2$usertype, FUN = min)"
   ]
  },
