   "source": [
    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "- Casual riders trips last in average longer (1822s, 30 min approx)  than trips by members (788s,13 min approx). Approx 2x longer.\n",
    "- The most often register durations are 833s for casual riders (around 14 min) and 546s for members (around 10 min).\n",
    "\n",
    "## 3. Comparative Usage by Yearly **Months** <a class=\"anchor\"  id=\"subsection6_3\"></a>\n",
    "Now we will focus on comparing the number of rides by user type through the months of the year. This way, we can delineate the behaviour of both user types through the year. We can also introduce the `duration_seconds` variable to check how the duration of the rides varies along different months. We will also create visualizations to help us interpret the results."
   ]
