   "source": [
    "# Create a subset table\n",
    "user_month <- total_trips_v2 %>% \n",
    "  group_by(usertype, month) %>%\n",
    "  summarise(number_of_rides = n(),\n",
    "            average_duration = mean(duration_seconds),\n",
    "            max_duration = max(duration_seconds)) %>% \n",
    "  arrange(month)\n",
    "\n",
    "# Number of Rides per Usertype by Month\n",
    "user_month %>%\n",
    "  ggplot(aes(x = month(month, label = TRUE, abbr = TRUE), y = number_of_rides, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "  labs(title = \"Number of Rides per Usertype by Month\",\n",
    "        x = \"\",\n",
    "        y = \"Number of Rides\",\n",
    "        fill = \"Usertype\",\n",
    "        subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") + \n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    axis.text = element_text(size = 10, color = \"black\"),\n",
    "    axis.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.text = element_text(size = 10, color = \"black\"),\n",
    "    plot.title = element_text(size = 14, color = \"black\")\n",
    "  )\n",
    "# CONCLUSION: casual max rides month: JUL -- member max rides month: AUG\n",
    "user_month %>% \n",
    "  arrange(desc(number_of_rides))\n",
    "# CONCLUSION: casual 3 max rides months: JUL,AUG,JUN -- member 3 max rides months: AUG,JUL,SEP\n",
    "\n",
    "# Rides Duration per Usertype by Month\n",
    "user_month %>%\n",
    "  ggplot(aes(x = month(month, label = TRUE, abbr = TRUE), y = average_duration, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "    \n",
    "  labs(title = \"Average Trip Duration per Usertype by Month\",\n",
    "        x = \"\",\n",
    "        y = \" Trip Duration (s)\",\n",
    "        fill = \"Usertype\",\n",
    "        subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") + \n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    axis.text = element_text(size = 10, color = \"black\"),\n",
    "    axis.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.text = element_text(size = 10, color = \"black\"),\n",
    "    plot.title = element_text(size = 14, color = \"black\")\n",
    "  )\n",
    "# TOP 3 Months (Average Duration Rides) Casual Riders\n",
    "top3months_casual <- user_month %>%\n",
    "  filter(usertype==\"casual\") %>% \n",
    "  mutate(month = month(month, label = TRUE, abbr = TRUE)) %>% \n",
    "  arrange(desc(average_duration)) %>%\n",
    "  slice_head(n=3)\n",
    "top3months_casual\n",
    "# TOP 3 Months (Average Duration Rides) Member\n",
    "top3months_member <- user_month %>%\n",
    "  filter(usertype==\"member\") %>% \n",
    "  mutate(month = month(month, label = TRUE, abbr = TRUE)) %>% \n",
    "  arrange(desc(average_duration)) %>%\n",
    "  slice_head(n=3)\n",
    "top3months_casual\n",
    "# CONCLUSION: casual max avg duration: JUN -- member max avg duration: JUN\n",
    "# CONCLUSION: casual 3max avg duration: JUN, MAY, APR -- member 3max avg duration: JUN, JUL, AUG\n"
   ]
  },
