    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "- Casual riders trips last in average longer (1822s, 30 min approx)  than trips by members (788s,13 min approx). Approx 2x longer.\n",
    "- The most often register durations are 833s for casual riders (around 14 min) and 546s for members (around 10 min).\n",
    "\n",
    "## 4. Comparative Usage by **Weekday** <a class=\"anchor\"  id=\"subsection6_4\"></a>\n",
    "Let's analyze now how casual riders and members use Cyclistic services depending on the weekday. This way, we could infer if they ride our bikes during leisure time or if they use the service for communiting (although further studies will be necessary to confirm this assumptions)."
   ]
