   "source": [
    "# Subset table for user and weekday rides\n",
    "user_weekday <- total_trips_v2 %>%\n",
    "  mutate(weekday = factor(weekday, levels = c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\", \"Sat\", \"Sun\"))) %>% # This is necessary for ordering the days of the week\n",
    "  group_by(usertype, weekday) %>% # Group by user type and weekday\n",
    "  summarise(number_of_rides = n(),\n",
    "            average_duration = mean(duration_seconds),\n",
    "            max_duration = max(duration_seconds)) %>% \n",
    "  arrange(weekday)\n",
    "\n",
    "# Number of Rides per Usertype by Weekday\n",
    "user_weekday %>%\n",
    "  ggplot(aes(x = weekday, y = number_of_rides, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "  labs(title = \"Number of Rides per Usertype by Weekday\",\n",
    "       x = \"\",\n",
    "       y = \"Number of Rides\",\n",
    "       fill = \"Usertype\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    axis.text = element_text(size = 10, color = \"black\"),\n",
    "    axis.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.text = element_text(size = 10, color = \"black\"),\n",
    "    plot.title = element_text(size = 14, color = \"black\")\n",
    "  )\n",
    "# CONCLUSION: casual riders usage at weekends, members at weekdays\n",
    "\n",
    "# Rides Duration per Usertype by Weekday\n",
    "user_weekday %>%\n",
    "  ggplot(aes(x = weekday, y = average_duration, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "  labs(title = \"Average Trip Duration per Usertype by Weekday\",\n",
    "       x = \"\",\n",
    "       y = \" Trip Duration (s)\",\n",
    "       fill = \"Usertype\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    axis.text = element_text(size = 10, color = \"black\"),\n",
    "    axis.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.text = element_text(size = 10, color = \"black\"),\n",
    "    plot.title = element_text(size = 14, color = \"black\")\n",
    "  )\n",
    "# CONCLUSION: Average duration of casual riders increases at weekends, members stable"
   ]
