   "source": [
    "I am also interested in representing the **differential behaviour** between casual riders and members through **weekdays (Mon ‚Äì Fri)** and **weekends (Sat ‚Äì Sun)**. In order to do that, I will represent the number of trips taken place within these two time periods.\n",
    "> <div class=\"alert alert-block alert-warning\">\n",
    "    Please note that <b>weekdays span more days (5) than weekend days (2)</b>. This means that the sum of rides on weekdays will overrepresent this data in comparasion with the sum of rides on weekend days. In order to avoid that, we will perform a <b>normalization</b> of the respective sums by the number of days of each period of days (sum  / 5 or sum / 2) </div>"
   ]
  },
