   "source": [
    "# Subset of data\n",
    "user_weekend <- total_trips_v2 %>%\n",
    "  mutate(day_category = ifelse(weekday %in% c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\"), \"Weekday\", \"Weekend\")) %>%\n",
    "  group_by(usertype, day_category) %>% # Group by user and day category\n",
    "  summarise(number_of_rides = n(),\n",
    "            average_duration = mean(duration_seconds)) %>% \n",
    "  mutate(total_days = ifelse(day_category == \"Weekday\", 5, 2), # Define total days based on day category\n",
    "         normalized_rides = number_of_rides / total_days) # Perform normalisation\n",
    "# Viz of data\n",
    "user_weekend %>%\n",
    "  ggplot(aes(x = usertype, y = normalized_rides, fill = day_category)) +\n",
    "  geom_bar(stat= \"identity\", position = \"dodge\") + \n",
    "  labs(title = \"Number of Rides per Usertype by Week Period\",\n",
    "       x = \"\",\n",
    "       y = \"Number of Rides\",\n",
    "       fill = \"Week Period\",\n",
    "       subtitle = \"January 2021 - November 2023 / Normalized per days on period\") +\n",
    "  scale_fill_brewer(palette = \"Set3\") +  # Using a different color palette\n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    axis.text = element_text(size = 10, color = \"black\"),\n",
    "    axis.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.title = element_text(size = 12, color = \"black\"),\n",
    "    legend.text = element_text(size = 10, color = \"black\"),\n",
    "    plot.title = element_text(size = 14, color = \"black\")\n",
    "  )"
   ]
  },
