   "source": [
    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "- Member usage is slightly higher on weekdays (Mon ‚Äì Fri) than at weekends, impliying possible commuting purposes. The average ride duration remains stable through every day of the week.\n",
    "- Casual riders usage is increased at weekends, implying usage of Cyclistic on leisure time. The average ride duration increases at weekends.\n",
    "\n",
    "## 5. Comparative Usage by **Daily Hours** <a class=\"anchor\"  id=\"subsection6_5\"></a>\n",
    "The next questions that arise concern the distribution of members and casual riders trips through the day. Are there any peak / rush hours? Do casual riders and members like to use Cyclistic in different period of the day? In order to answer this, we would look at the average number of rides per hour, which will depict an average day on Cyclistic's life. As we have already seen some differences between members and casual riders usages by weekday / weekend, we will also make the respective calculations and visualisations for the respective weekly periods."
   ]
