   "source": [
    "# Create a subset of data for visualisations by ride duration\n",
    "user_hour_duration <- total_trips_v2 %>%\n",
    "  mutate(day_category = ifelse(weekday %in% c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\"), \"Weekday\", \"Weekend\")) %>%\n",
    "  group_by(usertype, hour, day_category) %>% # Group by user type and hour\n",
    "  summarise(number_of_rides = n(),\n",
    "            average_duration = mean(duration_seconds),\n",
    "            max_duration = max(duration_seconds))\n",
    "\n",
    "# Create a subset of data for average rides per hour\n",
    "user_hour <- total_trips_v2 %>%\n",
    "  mutate(day_category = ifelse(weekday %in% c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\"), \"Weekday\", \"Weekend\"),\n",
    "         date_only = as.Date(started_at)) %>%\n",
    "  group_by(date_only, usertype, hour, day_category) %>% # Group by user type and hour\n",
    "  summarise(number_of_rides = n(),\n",
    "            average_duration = mean(duration_seconds),\n",
    "            max_duration = max(duration_seconds)) %>%\n",
    "  group_by(usertype, hour, day_category) %>% \n",
    "  summarise(average_rides_per_hour = mean(number_of_rides)) %>% \n",
    "  group_by(usertype, hour, day_category) %>% \n",
    "  summarise(average_rides_per_hour_per_user = mean(average_rides_per_hour))\n",
    "\n",
    "# Calculate peak hours\n",
    "peak_hours <- user_hour %>%\n",
    "  group_by(usertype, day_category) %>% \n",
    "  arrange(desc(average_rides_per_hour_per_user)) %>% \n",
    "  slice_head(n=1)\n",
    "peak_hours\n",
    "#CONCLUSIONS: casual riders peak hour: 15(weekends) --- 17(weekdays)\n",
    "            # member riders peak hour: 17(weekdays) --- 15(weekends)\n",
    "\n",
    "# Visualize average rides per hour per user type\n",
    "user_hour %>%\n",
    "  ggplot(aes(x = hour, y = average_rides_per_hour_per_user, color = usertype)) +\n",
    "  geom_line() + \n",
    "  labs(title = \"Number of Rides per Usertype by Hour\",\n",
    "       x = \"Hours\",\n",
    "       y = \"\",\n",
    "       color = \"Usertype\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_color_brewer(palette = \"Set2\", direction = 1) +  # Using a different color palette\n",
    "  theme_minimal() +\n",
    "  facet_wrap(~ day_category, scales = \"free_x\")\n",
    "\n",
    "# Duration of Rides per Usertype by Hour\n",
    "user_hour_duration %>%\n",
    "  ggplot(aes(x = hour, y = average_duration, fill = usertype)) +\n",
    "  geom_area(position = \"stack\") + \n",
    "  labs(title = \"Average Ride Duration per Usertype by Hour\",\n",
    "       x = \"Hour of Day\",\n",
    "       y = \"Seconds\",\n",
    "       fill = \"Usertype\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n",
    "  theme_minimal() +\n",
    "  facet_wrap(~ day_category)\n"
   ]
  },
