   "source": [
    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "- Member rides have two peaks under the week: between 8 - 7 hrs. and at around 17 hrs. This reinforces the hypothesis that member usage is related to commuting purposes. \n",
    "- Casual rides have only one peak under the week, at 17 hrs, this means after the usual working hours. Again, we have an insight of usage for leisure purposes. \n",
    "- At weekends, both members and casual rides have a more normal distribution of rides through the day with an increase at mid-day - afternoon.\n",
    "- Of note, rides duration of casual rides increases after midnight. This might be dued to usage as an alternative to public transportation when this service is closed late at night.\n",
    "\n",
    "## 6. Comparative Usage by **Rideable Type** <a class=\"anchor\"  id=\"subsection6_6\"></a>\n",
    "We will focus now on analysing the type of services our user types prefer. We have 3 types of rideable bikes on our data base:\n",
    "- Classic bike\n",
    "- Docked bike\n",
    "- Electric bike\n",
    "\n",
    "Let's see how the usage of these bikes is distributed by user type and other parameters!"
   ]
  },
