    "# Create subset of data\n",
    "rideable_user <- total_trips_v2 %>% \n",
    "  group_by(usertype, rideable_type) %>% \n",
    "  summarise(number_of_trips = n(),\n",
    "            average_duration = mean(duration_seconds))%>%\n",
    "  mutate(percentage = round(number_of_trips / sum(number_of_trips) * 100))\n",
    "\n",
    "view(rideable_user)\n",
    "\n",
    "# Check rideable types totals per user type\n",
    "rideable_user %>%\n",
    "  ggplot(aes(x = usertype, y = number_of_trips, fill = rideable_type)) +\n",
    "  geom_col(position = \"stack\") + \n",
    "  labs(title = \"Rides per Rideable Type by User type\",\n",
    "       x = \"User type\",\n",
    "       y = \"Number of rides\",\n",
    "       fill = \"Rideable type\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") + \n",
    "  theme_minimal()\n",
    "\n",
    "# Per month\n",
    "rideable_user_month <- total_trips_v2 %>% \n",
    "  group_by(usertype, rideable_type, month) %>% \n",
    "  summarise(number_of_trips = n(),\n",
    "            average_duration = mean(duration_seconds))\n",
    "\n",
    "rideable_user_month %>%\n",
    "  ggplot(aes(x = month(month, label=TRUE), y = number_of_trips, fill = rideable_type)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "  labs(title = \"Rides per Rideable Type per Usertype by Month\",\n",
    "       x = \"\",\n",
    "       y = \"Number of rides\",\n",
    "       fill = \"Rideable type\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n",
    "  theme_minimal() + \n",
    "  facet_wrap(~ usertype)\n",
    "\n",
    "# Per weekday\n",
    "rideable_user_weekday <- total_trips_v2 %>% \n",
    "  group_by(usertype, rideable_type, weekday) %>% \n",
    "  summarise(number_of_trips = n(),\n",
    "            average_duration = mean(duration_seconds))\n",
    "\n",
    "rideable_user_weekday %>%\n",
    "  ggplot(aes(x = weekday, y = number_of_trips, fill = rideable_type)) +\n",
    "  geom_col(position = \"stack\") + \n",
    "  labs(title = \"Rides per Rideable Type per Usertype by Weekday\",\n",
    "       x = \"\",\n",
    "       y = \"Number of rides\",\n",
    "       fill = \"Rideable type\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") +  # Using a different color palette\n",
    "  theme_minimal() + \n",
    "  facet_wrap(~ usertype)"
   ]
  },
