   "source": [
    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "- What first strikes out is the usage of **docked bikes only by casual users**, except from **one member ride**. There should be more investigation on what is the difference between classic bikes and docked bikes to really draw any conclusion regarding this point.\n",
    "- There is a **similiar number of rides of classic and electric bikes** by both user types (47% of rides for casual riders and 45% for members). \n",
    "- To get a more accurate picture of usage habits, we would need to get the s**tock number of classic and electric bikes**. If there is a big difference of the number of bikes, for instance many more classic bikes than electric, we could safely conclude that, although the number of electric bikes rides is smaller, clients tend to prefer this rideable type.\n",
    "\n",
    "## 7. Most Used **Stations** <a class=\"anchor\"  id=\"subsection6_7\"></a>\n",
    "The data for performing this analysis has some limitations. We have some NA's or empty values for data regarding the information about stations names, ids, latitude and longitude, as we have already seen during the cleaning step. Now it is time to get ride of these NA values!\n",
    "> <div class=\"alert alert-block alert-warning\">\n",
    "    While working with this data, I checked if it was possible to infer the names of the stations by their IDs, or vice versa, but I could only use these procedure for 2 IDs, so I will just proceed to clean the data without taking this approach.\n",
    "    Other aspect to take into account is that <b>I don't want this cleaning step to affect the representativeness of my data</b>. This will be handled in the code below.\n",
    "   </div>"
   ]
