   "source": [
    "# I am going to create a subset of data dropping the rows where no values are available for start and end stations names\n",
    "subset_no_NA_stations_names <- total_trips_v2 %>% \n",
    "  filter(complete.cases(start_station_name, end_station_name) | (!is.na(start_station_name) & !is.na(end_station_name)))\n",
    "\n",
    "# Clean empty strings. This is necessary because some strings empty are not detected as NA values\n",
    "subset_no_NA_stations_names <- subset_no_NA_stations_names %>%\n",
    "  filter(complete.cases(start_station_name, end_station_name) &\n",
    "         start_station_name != \"\" &\n",
    "         end_station_name != \"\")\n",
    "\n",
    "colSums(is.na(subset_no_NA_stations_names))\n",
    "\n",
    "\n",
    "# Now I would like to see if there is a bias in user_type by this cleaning step\n",
    "proportion <- subset_no_NA_stations_names %>%\n",
    "  group_by(usertype) %>% \n",
    "  summarise(rides = n()) %>% \n",
    "  mutate(percentage = round(rides / sum(rides) * 100))\n",
    "\n",
    "lbls <- paste(proportion$usertype, proportion$percentage) # add percents to labels\n",
    "\n",
    "lbls <- paste(lbls,\"%\",sep=\"\") # add % to labels\n",
    "\n",
    "pie(proportion$rides, labels = lbls,  main = \"Casual Riders / Members\")\n",
    "# Ok it looks like there is no huge deviation of proportion of user type. It remains around 40 / 60 %"
   ]
  },
