   "source": [
    "# Let's check the top used stations for members\n",
    "top_stations_members <- subset_no_NA_stations_names %>% \n",
    "  filter(usertype == \"member\") %>%\n",
    "  group_by(start_station_name) %>% \n",
    "  summarise(number_rides = n(),\n",
    "            lng = first(start_lng),\n",
    "            lat = first(start_lat))\n",
    "# Viz\n",
    "top_stations_members %>%\n",
    "  arrange(desc(number_rides))%>%\n",
    "  head(n=10)%>%\n",
    "  ggplot(aes(x = reorder(start_station_name, number_rides), y = number_rides)) +\n",
    "  geom_col(fill = \"skyblue\", position = \"dodge\") + \n",
    "  coord_flip() +\n",
    "  labs(title = \"Top10 Stations MEMBERS\",\n",
    "       x = \"Station\",\n",
    "       y = \"Number of rides\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  theme_minimal()\n",
    "  \n",
    "\n",
    "# Let's check the top used stations for casual riders\n",
    "top_stations_casual <- subset_no_NA_stations_names %>% \n",
    "  filter(usertype == \"casual\") %>%\n",
    "  group_by(start_station_name) %>% \n",
    "  summarise(number_rides = n(),\n",
    "            lng = first(start_lng),\n",
    "            lat = first(start_lat))\n",
    "# Viz\n",
    "top_stations_casual %>%\n",
    "  arrange(desc(number_rides))%>%\n",
    "  head(n=10)%>%\n",
    "  ggplot(aes(x = reorder(start_station_name, number_rides), y = number_rides)) +\n",
    "  geom_col(fill = \"skyblue\", position = \"dodge\") + \n",
    "  coord_flip() +\n",
    "  labs(title = \"Top10 Stations CASUAL RIDERS\",\n",
    "       x = \"Station\",\n",
    "       y = \"Number of rides\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_color_brewer(palette = \"Set2\", direction = 1) +  \n",
    "  theme_minimal()\n"
   ]
  },
