   "source": [
    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "From this analysis, the main conclusion I can get is that **casual riders** use the station **Streeter Dr & Grand Ave** very often, there is a difference of more than 2x times with the second most used station, **Millennium Park**. This could be useful for making advertising campaigns in around this station. I will take a closer look to see at what days and hours is this station so demanded. I will also check if there is any notable increase of usage by month."
   ]
