   "source": [
    "# Subset of dataset with the trips for Streeter Dr & Grand Ave station grouped by usertype, weekday and hour\n",
    "station_hour <- total_trips_v2 %>%\n",
    "  filter(start_station_name == \"Streeter Dr & Grand Ave\") %>% \n",
    "  mutate(day_category = ifelse(weekday %in% c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\"), \"Weekday\", \"Weekend\"),\n",
    "         date_only = as.Date(started_at)) %>%\n",
    "  group_by(date_only, usertype, hour, day_category) %>% # Group by user type and hour\n",
    "  summarise(number_of_rides = n(),\n",
    "            average_duration = mean(duration_seconds),\n",
    "            max_duration = max(duration_seconds)) %>%\n",
    "  group_by(usertype, hour, day_category) %>% \n",
    "  summarise(average_rides_per_hour = mean(number_of_rides)) %>% \n",
    "  group_by(usertype, hour, day_category) %>% \n",
    "  summarise(average_rides_per_hour_per_user = mean(average_rides_per_hour))\n",
    "# Visualize results\n",
    "station_hour %>%\n",
    "  ggplot(aes(x = hour, y = average_rides_per_hour_per_user, color = usertype)) +\n",
    "  geom_line() + \n",
    "  labs(title = \"Number of Rides per Usertype by Hour at Streeter Dr & Grand Ave\",\n",
    "       x = \"Hours\",\n",
    "       y = \"\",\n",
    "       color = \"Usertype\",\n",
    "       subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_color_brewer(palette = \"Set2\", direction = 1) +  \n",
    "  theme_minimal() +\n",
    "  facet_wrap(~ day_category, scales = \"free_x\")\n",
    "\n",
    "# Create a subset table with trips on chosen station grouped by usertype and month\n",
    "station_month <- total_trips_v2 %>% \n",
    "  filter(start_station_name == \"Streeter Dr & Grand Ave\") %>%\n",
    "  group_by(usertype, month) %>%\n",
    "  summarise(number_of_rides = n()) %>% \n",
    "  arrange(month)\n",
    "# Visualize results\n",
    "station_month %>%\n",
    "  ggplot(aes(x = month(month, label = TRUE, abbr = TRUE), y = number_of_rides, fill = usertype)) +\n",
    "  geom_col(position = \"dodge\") + \n",
    "  labs(title = \"Number of Rides per Usertype by Month at Streeter Dr & Grand Ave\",\n",
    "        x = \"\",\n",
    "        y = \"Number of Rides\",\n",
    "        fill = \"Usertype\",\n",
    "        subtitle = \"January 2021 - November 2023\") +\n",
    "  scale_fill_brewer(palette = \"Set2\") + \n",
    "  theme_minimal() +\n",
    "  theme(\n",
    "    axis.text = element_text(size = 10, color = \"black\"),\n",
    "    axis.title = element_text(size = 12, color = \"black\"),\n",
