   "source": [
    "This means it might be useful to focus campaigns on getting new member users around **Streeter Dr & Grand Ave** station at **weekends** on the **summertime**.\n",
    "\n",
    "### Geographical Visualizations\n",
    "\n",
    "For the sake of practice and clarification, we will  also perform an analysis including the different neighborhoods of the Chicago city and the trips started on each of them. But for this purpose, we need the **data for the localization of these neighborhoods**, as downloaded from the [Chicago Data Portal](https://data.cityofchicago.org/Facilities-Geographic-Boundaries/Boundaries-Neighborhoods/bbvz-uum9). \n",
    "\n",
    "We will first load the libraries necessary for the graphical representation and then, load the data that we have previously upload to our Cyclistic Database."
   ]
  },
