    "# Import packages and load libraries for map representation\n",
    "library(ggplot2)\n",
    "library(sf)\n",
    "library(rnaturalearth) # Provides a map of countries of the entire world\n",
    "library(rnaturalearthdata) # Provides the data of map of countries of the entire world\n",
    "library(ggrepel)\n",
    "\n",
    "# Read data for map of Chicago neighborhoods\n",
    "chicago_neighborhoods <-  st_read('../input/cyclistic-data/Boundaries - Community Areas (current).geojson')\n",
    "\n",
    "# Map for whole world in sf format\n",
    "world <- ne_countries(scale = \"medium\", returnclass = \"sf\")"
   ]
