   "source": [
    "For drawing maps, `ggplot2` reads geographical position (such us longitude and latitude) as `sf` format. Thats why we have to convert the `start_ln` and `start_lat` to `sf` format, creating map points with the information for the stations position. We will group this data by `start_station_name` and `usertype`."
