   "source": [
    "# Convert Chicago data to sf format\n",
    "neighborhoods <- st_as_sf(chicago_neighborhoods)\n",
    "\n",
    "# Convert stations data to spatial data \n",
    "start_points <- st_as_sf(subset_no_NA_stations_names, coords = c(\"start_lng\", \"start_lat\"), crs = st_crs(neighborhoods))\n",
    "\n",
    "start_points_by_station <- start_points %>% \n",
    "  group_by(start_station_name, usertype)%>% \n",
    "  summarise(number_rides = n(),\n",
    "            geometry = first(geometry))\n",
    "summary(start_points_by_station) # 1928 station names"
   ]
  },
