   "source": [
    "# Graphical representations\n",
    "\n",
    "# Rides on Chicago neighborhoods\n",
    "ggplot(data = world) +\n",
    "  geom_sf() +\n",
    "  geom_sf(data=neighborhoods, fill = NA) +\n",
    "  geom_sf(data = rides_neighborhood, aes(fill = number_rides)) + \n",
    "  coord_sf(xlim = c(-88., -87.5), ylim = c(41.6, 42), expand = TRUE)+\n",
    "  xlab(\"Longitude\") + ylab(\"Latitude\") +\n",
    "  ggtitle(\"Chicago Neighborhoods - Number of rides\") +\n",
    "  facet_wrap(~ usertype)\n",
    "\n",
    "# Top5 neighborhoods MEMBER\n",
    "ggplot(data = world) +\n",
    "  geom_sf() +\n",
    "  geom_sf()+\n",
    "  geom_sf(data=neighborhoods, fill = NA) +\n",
    "  geom_sf(data = top5_neighborhood_member, aes(fill = number_rides)) + \n",
    "  geom_label(data = top5_neighborhood_member, \n",
    "             aes(X, Y, label = community), \n",
    "             size = 2, \n",
    "             fontface = \"bold\", \n",
    "             nudge_y = top5_neighborhood_member$nudge_y) +\n",
    "  coord_sf(xlim = c(-87.73, -87.57), ylim = c(41.85, 41.97), expand = TRUE)+\n",
    "  xlab(\"Longitude\") + ylab(\"Latitude\") +\n",
    "  ggtitle(\"Top 5 Districts - MEMBERS\")\n",
    "\n",
    "#Top5 neighborhoods CASUAL\n",
    "ggplot(data = world) +\n",
    "  geom_sf() +\n",
    "  geom_sf(data=neighborhoods, fill = NA) +\n",
    "  geom_sf(data = top5_neighborhood_casual, aes(fill = number_rides)) + \n",
    "  geom_label(data = top5_neighborhood_casual, \n",
    "             aes(X, Y, label = community), \n",
    "             size = 2, \n",
    "             fontface = \"bold\", \n",
    "             nudge_y = top5_neighborhood_casual$nudge_y) +\n",
    "  coord_sf(xlim = c(-87.73, -87.57), ylim = c(41.85, 41.97), expand = TRUE) +\n",
    "  xlab(\"Longitude\") + ylab(\"Latitude\") +\n",
    "  ggtitle(\"Top 5 Districts - CASUAL RIDERS\")\n",
    "\n",
    "# Top stations MEMBER\n",
    "ggplot(data = world) +\n",
    "  geom_sf() +\n",
    "  geom_sf(data=neighborhoods, fill = NA) +\n",
    "  geom_sf(data = top5_stations_member, size = 4, aes(color = number_rides)) + \n",
    "  geom_label(data = top5_neighborhood_casual, \n",
    "             aes(X, Y, label = community), \n",
    "             size = 2) +\n",
    "  geom_text_repel(data = top5_stations_member, \n",
    "                  aes(X, Y, label = start_station_name),\n",
    "                  nudge_x = top5_stations_member$nudge_x,\n",
    "                  nudge_y = top5_stations_member$nudge_y) +\n",
    "  \n",
    "  coord_sf(xlim = c(-87.67, -87.60), ylim = c(41.87, 41.93), expand = TRUE) +\n",
    "  xlab(\"Longitude\") + ylab(\"Latitude\") +\n",
    "  ggtitle(\"Top 5 Stations - MEMBERS\")\n",
    "\n",
    "# Top stations CASUAL\n",
    "ggplot(data = world) +\n",
    "  geom_sf() +\n",
    "  geom_sf(data=neighborhoods, fill = NA) +\n",
    "  geom_sf(data = top5_stations_casual, size = 4, aes(color = number_rides)) + \n",
    "  geom_label(data = top5_neighborhood_casual, \n",
    "             aes(X, Y, label = community), \n",
    "             size = 2) +\n",
    "  geom_text_repel(data = top5_stations_casual, \n",
    "                  aes(X, Y, label = start_station_name),\n",
    "                  nudge_x = top5_stations_casual$nudge_x,\n",
    "                  nudge_y = top5_stations_casual$nudge_y) +\n",
    "  coord_sf(xlim = c(-87.65, -87.60), ylim = c(41.86, 41.91), expand = TRUE) +\n",
    "  xlab(\"Longitude\") + ylab(\"Latitude\") +\n",
    "  ggtitle(\"Top 5 Stations - CASUAL RIDERS\")"
   ]
  },
