   "source": [
    "#### **<span style=\"color:blue\">CONCLUSIONS</span>**\n",
    "\n",
    "This results show us that both annual members and casual riders start their rides in the **central neighborhoods** of Chicago, being the stations within the **Near North Side** the most demanded ones. Casual riders have a remarkable preference for starting their rides at **Streeter Dr & Grand Ave**, while the usage of top preferred stations for members is more homegeneous. Of note, some of the top used stations for casual riders might imply a leisure usage of Cyclistic, such as **Shed Aquarium**. \n",
    "\n",
    "> <div class=\"alert alert-block alert-warning\">\n",
    "    In spite of these results, we should <b> critically consider and evaluate the previous conclusions </b>. During the cleaning process, we have remove a considerable ammount of data that contained NA values or empty strings, so this analysis might not be representative. We should discuss this point with our team and also figure out why there is so much data missing regarding the starting and ending stations.\n",
    "   </div>"
   ]
  }
